import { useState, useEffect } from "react";

const MostrarProducto = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001/single_product/")
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);
  console.log(data);

  const mostrar = data.map((producto) => {
    return (
      <div>
        <h1>PRODUCTO: {producto.nombre}</h1>
        <p>PRECIO: {producto.precio}</p>
        <p>PRECIO: {producto.tipo}</p>
        <p>PRECIO: {producto.genero}</p>
        <p>PRECIO: {producto.grosores}</p>
        <p>PRECIO: {producto.tallas}</p>
        <p>PRECIO: {producto.descripcion}</p>
        <p>PRECIO: {producto.design}</p>
        <p>PRECIO: {producto.conception}</p>
        <p>PRECIO: {producto.confort}</p>
      </div>
    );
  });
  return mostrar;
};

export default MostrarProducto;
